import React from 'react';
import { Navbar, Nav } from "react-bootstrap";
import Container from 'react-bootstrap/Container';

function Header({ handleNavigationClick }) {
  return (
    <header>

      <Navbar sticky="top" className='font-bold border border-bg-black'>
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <nav>
        <ul>
          <li onClick={() => handleNavigationClick('projects')}>Projects</li>
          <li onClick={() => handleNavigationClick('about')}>About</li>
          <li onClick={() => handleNavigationClick('contact')}>Contact</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
